import { useDispatch, useSelector } from 'react-redux';
import { searchById } from '../../redux/action';




const Detail = () => {
    const { id } = useParams();
    const dogById = useSelector(state => state.DogsById)
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(searchById(id))
    }, []);

    console.log(dogById);
    return (
    <div>
        <div className="Detail">
            <card>
                <h2>{dogById.name}</h2>
                <img src={dogsById.image.url} alt=''/>image={image.url? image.url: image}

                    temperamen t={temperament}                     
                    life_span={life_span}
                    weight={weight? weight: weight.metric}
                    height={height? height: height.metric}
            </card>
        </div>
    </div>
    )
}

export default Detail
